function KycApplicationDetails(){HttpGet(`/Home/KycApplicationDetails/?Id=${$("#Id").val()==null?"":$("#Id").val()}`,"json",function(n){var t=document.getElementById("ChartForKycForm").getContext("2d"),i=new Chart(t,{type:"bar",data:{labels:["Pending","Approve","InProcess"],datasets:[{label:"# of Votes",data:[n[0].KycApplicaionPending,n[0].KycApplicaionApprove,n[0].KycApplicaionInProcess],label:"Kyc Application",backgroundColor:["Red","Green","Blue",],borderColor:["rgba(75, 192, 192, 1)","rgba(153, 102, 255, 1)","rgba(255, 159, 64, 1)"],borderWidth:1}]},options:{responsive:!1,scales:{y:{beginAtZero:!0}}}})})}function KycDemandPaymentDetails(){HttpGet(`/Home/KycDemandPaymentDetails/?Id=${$("#Id").val()==null?"":$("#Id").val()}`,"json",function(n){var t=document.getElementById("ChartForKycPaymentForm").getContext("2d"),i=new Chart(t,{type:"bar",data:{labels:["Pending","Approve","InProcess"],datasets:[{label:"# of Votes",data:[n[0].KycDemandPaymentPending,n[0].KycDemandPaymentApprove,n[0].KycDemandPaymentInProcess],label:"Kyc Demand Payment Application",backgroundColor:["Red","Green","Blue",],borderColor:["rgba(75, 192, 192, 1)","rgba(153, 102, 255, 1)","rgba(255, 159, 64, 1)"],borderWidth:1}]},options:{responsive:!1,scales:{y:{beginAtZero:!0}}}})})}$(document).ready(function(){KycApplicationDetails();KycDemandPaymentDetails()});